class Solution:    def uncommonFromSentences(self, A, B):        """        :type A: str        :type B: str        :rtype: List[str]        """        dicta,dictb={},{}        A=A.split()        B=B.split()        for i in A:            if i not in dicta:                dicta[i]=1            else:                dicta[i]+=1        for i in B:            if i not in dictb:                dictb[i]=1            else:                dictb[i]+=1        ans=[]        for (item,number) in dicta.items():            if number==1 and item not in dictb:                ans.append(item)        for (item,number) in dictb.items():            if number==1 and item not in dicta:                ans.append(item)        return ansA = "this apple is sweet"B = "this apple is sour"s=Solution()print(s.uncommonFromSentences(A,B))